  [],\n\t\"revision_timestamp\": \"2016-01-09T11:51:42.429012\",\n\t\"name\": \"reproductive-data-for-groundfish\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The ROCKFISH database houses data from
  rockfish species collected by the SWFSC FED along the California coast as part of
  a reproductive study originating in the winter of 2009 to assess spatial, environmental
  and maternal effects on egg production. Basic morphometric data, reproductive state,
  fecundity, condition, age, sampling location and dates are recorded.  In addition,
  historic datasets are being compiled and assimilated into the ROCKFISH database
  to compare current fecundity estimates to those in the 1950s, 80s, and 2000s from
  various published and unpublished sources.  Under construction are tables documenting
  an ongoing effort in production ageing of chilipepper rockfish collected by the
  NWFSC trawl survey to assess trends in mean size-at-age from the 1980s to current
  and estimate reader variability and error in age estimation.\",\n\t\"license_title\":
